% States: X = [20 disp, 1 AMD disp, 20 vel, 1 AMD vel]
%% Parameters
% Earthquake intensity
Ecase = 1;  % Earthquake case: 1: Kobe 2: El Centro
EI = 0.7;
% LQR gain
r_lqr = 10^-5;
q_lqr = 10^6;

% DoS vector: 0 to deactivate
DoS_s = ones(20,1);     % DoS semi-active
DoS_p = ones(20,1);     % DoS passive, leaave as vector of ones if doing semi-active attack
%% Structural Properties
% Mass(10^6) Kg
m(1)= 1.126; 
m(2:19)=1.1;
m(20)= 1.170;
m=m*1e6; %kg

% Interstory stiffness (10^3) KN/m;
k(1:5) = 862.07; 
k(6:11) = 554.17;
k(12:14) = 453.51;
k(15:17) = 291.23;
k(18:19) = 256.46;
k(20)=171.70;
k=k*1e3*1e3; % N/m

%% Characteristic matrices
% Mass Matrix
M = diag(m); 

% Stiffness Matrix
K=zeros(length(k)); 
for i=1:length(K)
    for j=1:length(K)
        if j==length(K) && i ==length(K)
            K(j,j)= k(end);
        elseif i == j
            K(i,i)=k(i)+k(i+1);  
        end
    end
end

for i=1:length(K)-1
    K(i,i+1)=-k(i+1);
end

for j=1:length(K)-1
    K(j+1,j)=-k(j+1);
end

% Damping matrix: Rayleigh using 5% in first two modes
[Phi,w2]=eig(K,M);      
[Wn,ord]=sort(sqrt(diag(w2)));
Tn=2*pi./Wn;
Phi=Phi(:,ord);

w1= Wn(1);
w2= Wn(2);

W=[1/w1 w1; 1/w2 w2];
zeta = [0.05;0.05];

syms aa0 aa1
[aa0,aa1]=solve(W*[aa0;aa1]==zeta);
aa0=sym2poly(aa0);
aa1=sym2poly(aa1);

Cc = aa0*M + aa1*K; % Damping Matrix
%% MR damper model
alph_a = 1.0872e07;  
alph_b = 4.9616e07;  

c0_a = 4.40e2;       
c0_b = 44.0e2;       

AA = 1.2;
GG = 300;      
BB = 300;      

eta=50;   
nloc = 20;
A1=[-eta*eye(nloc)];
B1=[eta*eye(nloc)];
C1=eye(nloc);
D1=zeros(nloc,nloc);
Kdev  = eye(20);  % force location
Umax = 10;      % max voltage

%% Uncontrolled State space model
n=20;
iota=ones(n,1);
A_ref = [...
    zeros(n,n) eye(n);
    -K/M -Cc/M];
E_ref = [...
    zeros(n,1);
    -eye(n)\iota];
Dri=diag(ones(n,1));    % drift computation for C
Dri(2:n+1:end)=-ones(n-1,1);
% C_ref = [Dri zeros(n)];
C_ref = [...
    eye(n) zeros(n,n);
    zeros(n,n) eye(n);
    Dri zeros(n);
    -K/M -Cc/M];
DD_ref = [zeros(4*n,1)];
% Uncontrolled state-space representation
Sys_unc = ss(A_ref,E_ref,C_ref,DD_ref);
  
%% Controlled state space model
iota=ones(20,1);
A = [...
    zeros(n,n) eye(n);
    -K/M -Cc/M];
E = [...
    zeros(n,1);
    -eye(n)\iota];
B = [...
    zeros(n);
    eye(n)/M];
Dri=diag(ones(n,1));    % drift computation for C
Dri(2:n+1:end)=-ones(n-1,1);
% C_ref = [Dri zeros(n)];
C = [...
    eye(n) zeros(n,n);
    zeros(n,n) eye(n);
    Dri zeros(n);
    -K/M -Cc/M];
D = [zeros(4*n,n+1)];
% Controlled state-space representation
Sys_con = ss(A,[E B],C,D);

%% Controller (LQR example)
r_lqr = 0.5*10^-5;
q_lqr = 10^6;
R=r_lqr*eye(n);
R(1:5,1:5)=20*R(1:5,1:5);
R(16:20,16:20)=0.3*R(16:20,16:20);
Q=q_lqr*eye(2*n);

K_lqr_un=lqr(A,B,Q,R);
K_lqr=K_lqr_un;

